use near_sdk::BorshStorageKey;
use near_sdk::borsh::{BorshDeserialize, BorshSerialize};
use near_sdk::collections::{LazyOption, LookupMap};
use near_sdk::json_types::{U128, Base64VecU8};
use near_sdk::{env, near_bindgen, AccountId, NearToken, PanicOnDefault, StorageUsage, NearSchema};

use hex::decode;

pub mod ft_core;
pub mod events;
pub mod metadata;
pub mod storage;
pub mod internal;

use crate::metadata::*;
use crate::events::*;

// The image base64
const DATA_IMAGE_SVG_GT_ICON: &str = "data:image/jpeg;base64,";

/// The specific version of the standard we're using
pub const FT_METADATA_SPEC: &str = "ft-1.0.0";

pub const ZERO_TOKEN: NearToken = NearToken::from_yoctonear(0);

#[near_bindgen]
#[derive(BorshDeserialize, BorshSerialize, PanicOnDefault)]
#[borsh(crate = "near_sdk::borsh")]
pub struct Contract {
    /// Keep track of each account's balances
    pub accounts: LookupMap<AccountId, NearToken>,

    /// Total supply of all tokens
    pub total_supply: NearToken,

    /// The bytes for the largest possible account ID that can be registered on the contract 
    pub bytes_for_longest_account_id: StorageUsage,

    /// Metadata for the contract itself
    pub metadata: LazyOption<FungibleTokenMetadata>,
}

/// Helper structure for keys of the persistent collections.
#[derive(BorshSerialize, BorshStorageKey)]
#[borsh(crate = "near_sdk::borsh")]
pub enum StorageKey {
    Accounts,
    Metadata
}

#[near_bindgen]
impl Contract {
    /// Add reset for development purpose (Remove on production)
    #[init]
    pub fn reset(owner_id: AccountId, total_supply: U128, metadata: FungibleTokenMetadata) -> Self {
        assert!(env::predecessor_account_id() == env::current_account_id(), "Only the contract owner can reset");

        let casted_total_supply = NearToken::from_yoctonear(total_supply.0);

        let mut this = Self {
            total_supply: casted_total_supply,
            // Set the bytes for the longest account ID to 0 temporarily until it's calculated later
            bytes_for_longest_account_id: 0,
            accounts: LookupMap::new(StorageKey::Accounts),
            metadata: LazyOption::new(StorageKey::Metadata, Some(&metadata)),
        };

        // Set the owner's balance to the total supply
        this.internal_deposit(&owner_id, casted_total_supply);

        // Emit a reset event or initial mint event
        FtMint {
            owner_id: &owner_id,
            amount: &casted_total_supply,
            memo: Some("Token supply reset and reinitialized"),
        }
        .emit();

        this
    }

    /// Initializes the contract with the given total supply owned by the given `owner_id` with
    /// default metadata (for example purposes only).
    #[init]
    pub fn new_default_meta(owner_id: AccountId, total_supply: U128) -> Self {
         // Calls the other function "new: with some default metadata and the owner_id & total supply passed in 
        Self::new(
            owner_id,
            total_supply,
            FungibleTokenMetadata {
                spec: FT_METADATA_SPEC.to_string(),
                name: "Years Of No Opposition".to_string(),
                symbol: "YONO".to_string(),
                icon: Some(DATA_IMAGE_SVG_GT_ICON.to_string()),
                reference: Some("https://yonocoin.web.id/reference.json".to_string()),
                reference_hash: Some(Base64VecU8::from(hex::decode("7e08372b69056460c127a51aa2899df0d888dc78055d3e3a1f2aa7665f7b0b3f").unwrap())),
                decimals: 8,
            },
        )
    }

    /// Initializes the contract with the given total supply owned by the given `owner_id` with
    /// the given fungible token metadata.
    #[init]
    pub fn new(
        owner_id: AccountId,
        total_supply: U128,
        metadata: FungibleTokenMetadata,
    ) -> Self {
        let casted_total_supply = NearToken::from_yoctonear(total_supply.0);
        // Create a variable of type Self with all the fields initialized. 
        let mut this = Self {
            // Set the total supply
            total_supply: casted_total_supply,
            // Set the bytes for the longest account ID to 0 temporarily until it's calculated later
            bytes_for_longest_account_id: 0,
            accounts: LookupMap::new(StorageKey::Accounts),
            metadata: LazyOption::new(
                StorageKey::Metadata,
                Some(&metadata),
            )
        };

        // Measure the bytes for the longest account ID and store it in the contract.
        this.measure_bytes_for_longest_account_id();

        // Register the owner's account and set their balance to the total supply.
        this.internal_register_account(&owner_id);
        this.internal_deposit(&owner_id, casted_total_supply);

        // Emit an event showing that the FTs were minted
        FtMint {
            owner_id: &owner_id,
            amount: &casted_total_supply,
            memo: Some("Initial token supply is minted"),
        }
        .emit();
    
        // Return the Contract object
        this
    }
}